var ogg_prefix = "data:audio/ogg;base64,",
    oggs = [
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        ""
    ];

function init() {
    document.getElementById("fart").addEventListener("click", randomFart);
    document.getElementById("chain").addEventListener("click", setChaining);
    document.getElementById("shake").addEventListener("click", setShaking);
    document.getElementById("fart-button").addEventListener("click", timedFart);

    if (localStorage.chaining === 'true') {
        document.querySelector("#chain input").checked = true;
    } else {
        document.querySelector("#chain input").checked = false;
    }

    if (localStorage.shaking === 'true') {
        document.querySelector("#shake input").checked = true;
        window.addEventListener("shake", randomFart);
    } else {
        document.querySelector("#shake input").checked = false;
    }

}

function randomFart() {
    var audio, prefix, randomOgg, randomChain;

    audio = oggs;
    prefix = ogg_prefix;
    randomChain = Math.floor(Math.random() * audio.length);

    var player = document.createElement("audio");
    document.body.appendChild(player);
    randomOgg = Math.floor(Math.random() * audio.length);
    player.src = prefix + audio[randomOgg];
    player.dataset['index'] = 1;
    player.dataset['chain'] = randomChain;
    player.play();

    if (localStorage.chaining === 'true') {
        player.addEventListener("ended", chainAudio);
    } else {
        player.addEventListener("ended", cleanAudio);
    }
}

function chainAudio(aEvent) {
    if (parseInt(aEvent.target.dataset['index'], 10) <=
        parseInt(aEvent.target.dataset['chain'], 10)) {
        var audio, prefix, randomOgg;
        audio = oggs;
        prefix = ogg_prefix;

        randomOgg = Math.floor(Math.random() * audio.length);
        aEvent.target.src = prefix + audio[randomOgg];
        aEvent.target.dataset['index'] = parseInt(aEvent.target.dataset['index'], 10) + 1;
        aEvent.target.play();
        aEvent.target.addEventListener("ended", chainAudio);
    } else {
        cleanAudio(aEvent);
    }
}

function cleanAudio(aEvent) {
    document.body.removeChild(aEvent.target);
}

function setChaining() {
    if (localStorage.chaining === "false" || localStorage.chaining === undefined) {
        localStorage.chaining = true;
        document.querySelector("#chain input").checked = true;
    } else {
        localStorage.chaining = false;
        document.querySelector("#chain input").checked = false;
    }
}

function setShaking() {
    if (localStorage.shaking === "false" || localStorage.shaking === undefined) {
        localStorage.shaking = true;
        document.querySelector("#shake input").checked = true;
        window.addEventListener("shake", randomFart);
    } else {
        localStorage.shaking = false;
        document.querySelector("#shake input").checked = false;
        window.removeEventListener("shake", randomFart);
    }
}

function timedFart(aEvent) {
    var time = parseInt(this.previousElementSibling.value, 10) * 1000;
    setTimeout(randomFart, time);
}

window.addEventListener("load", init);
